# Dict of allowed kit names and numbers
KIT_INT_DICT = {48: 'WT', 12: 'WT_mini', 96: 'WT_mega'}
KIT_STR_DICT = {v:k for k,v in KIT_INT_DICT.items()}
KIT_STR_LC_DICT = {v.lower():k for k,v in KIT_INT_DICT.items()}

def get_kit_int_dict(strict=True):
    """ Return dict with allowed kit info
    """
    answer = {}
    if strict:
        for k in KIT_INT_DICT.keys():
            if k > 1:
                answer[k] = KIT_INT_DICT[k]
    else:
        answer = KIT_INT_DICT
    return answer


def parse_kit(kit, strict=False):
    """ Attempt to parse given kit into cannonical string and int

    Try to get standardized value from 'kit'; Else return 0 and given kit

    Return (int, str)
    """
    # Make sure string (e.g. in case given int)
    kit = str(kit)
    # As-given try to match name first; Get int
    if (not strict) and (kit.lower() in KIT_STR_LC_DICT):
        pkit = KIT_STR_LC_DICT[kit.lower()]
    elif kit in KIT_STR_DICT:
        pkit = KIT_STR_DICT[kit]
    else:
        pkit = kit
    # regex so can extract number from string (e.g. 'B96' >--> 96)
    ok, n = str_to_num(pkit, regex=True)
    if not ok:
        n = 0
    # Standard name via int
    if n in KIT_INT_DICT:
        kit = KIT_INT_DICT[n]
    else:
        n = 0
    return n, kit


def report_valid_kits(strict=True, pad=True):
    """ Report kit collection
    """
    kit_dict = get_kit_int_dict(strict=strict)
    if pad:
        print()
    print(f"There are {len(kit_dict)} installed kits:\n")
    for n in sorted(kit_dict.keys()):
        print(f"    {kit_dict[n]:10s} {n} wells")
    if pad:
        print()
        
        
def get_kit_bc_sets(kit, verb=True):
    """ Get barcode sets for kit
    
    Return 1-based list of barcode kit name lists
    """
    kit_n, kit_s = parse_kit(kit)
    bc_sets = None
    # Kit-specific barcode sets defined here
    if kit_n == 12:
        bc_sets = "zero,n24_v4,v1,v1".split(',')
    elif kit_n == 96:
        bc_sets = "zero,n192_v4,v1,v1".split(',')
    elif kit_n == 48:
        bc_sets = "zero,v2,v1,v1".split(',')
    else:
        print(f"Problem setting barcodes; Bad kit '{kit}'")
        return None
    # Story
    if verb:
        print(f"# Barcodes set for kit {kit_s} ({kit_n})")
    return bc_sets


def kit_round1_bc_dict():
    """ Get dict mapping kit to name of round1 barcode set
    
    Return dict
    """
    new_dict = {}
    for i, name in get_kit_int_dict().items():
        new_dict[name] = get_kit_bc_sets(name, verb=False)[1]
    return new_dict


### --------------------------- options / filenames / feedback ------------------------
def set_def_options(comargs):
    # Hardcode options
    comargs.sample = comargs.group
    comargs.edit_dist = DEF_BC_EDIT_DIST
    comargs.no_opref = False
    comargs.kit_score_min = KIT_SCORE_MIN


def check_options(comargs):
    """ Check options and make consistent

    Some values inserted into comargs structure
    """
    set_def_options(comargs)

    # Input filenames
    if not comargs.fq1:
        print("Need to specify fastq files; Try --help or --explain")
        return False
    # fq2 maybe from fq1  
    if not comargs.fq2:
        parts = comargs.fq1.split('R1')
        # Make sure 'R1' is in name and only sub last instance
        #   e.g. '/pathR1/examR1.fq' >--> '/pathR1/examR2.fq'
        if len(parts) > 1:
            comargs.fq2 = 'R1'.join(parts[:-1]) + 'R2' + parts[-1]
        else:
            print("Problem getting R2 name from R1 fastq")
            print(comargs.fq1)
            return False
        
    # Check files are good; Also reports if bad and expands env vars
    comargs.fq1 = check_infile(comargs.fq1, verb=True)
    comargs.fq2 = check_infile(comargs.fq2, verb=True)
    if (not comargs.fq1) or (not comargs.fq2):
        print("Problem with input files")
        return False

    if comargs.gfile:
        comargs.gfile = check_infile(comargs.gfile, verb=True)
        if not comargs.gfile:
            print("Problem with group specification list")
            return False
        
    # Given kit must be legit
    if comargs.kit:
        kit_n, kit_s = parse_kit(comargs.kit)
        if not kit_n:
            print("Problem with given kit '{comargs.kit}'")
            report_valid_kits()
            return False
    
    # Edit distance 
    if not 0 <= comargs.edit_dist <= 2:
        print(f"Bad edit distance {comargs.edit_dist}; Allowed 0 - 2")
        return False

    # Ouptut filename prefix
    if comargs.no_opref:
        comargs.opref = ''
    else:
        comargs.opref = DEF_OPREF

    # Range of records to process
    ok, first, last = parse_range_list(comargs.range)
    if not ok:
        print(f"Bad range given; {args.range}")
        return False
    comargs.rec_first = first
    comargs.rec_last = last
    
    return True


def check_infile(fname, verb=True, toxic=False):
    """ Check file
    
    Return filename, possibly expanded if env var
    """
    r_fname = ''
    # Expand any env vars; User for ~/ and vars for $home
    fname = os.path.expanduser(fname)
    fname = os.path.expandvars(fname)
    # Read access means input is good
    if os.access(fname, os.R_OK):
        r_fname = fname
    else:
        story = f"Cannot read file: '{fname}'"
        if toxic:
            raise IOError(story)
        if verb:
            print(story)
    return r_fname


def parse_range_list(rlis, warn=True):
    """ Parse range list; maybe [], [end], [start,end] 

        first and last default zero; If given, set as int

        Return status,first,last
    """
    ok = True
    first = last = 0
    if rlis:
        if len(rlis) > 1:
            if (len(rlis) > 2) and warn:
                print(f"Extra range args ignored; {rlis}")
            ok,first = str_to_num(rlis[0])
            if ok:
                ok,last= str_to_num(rlis[1])
        else:
            ok,last = str_to_num(rlis[0])
    return ok, first, last 


def range_story(r_ends):
    first = last = ''
    if r_ends:
        if len(r_ends) > 1:
            first, last = r_ends[:2]
        else:
            last = r_ends[0]
    if first and last:
        story = f"From {first} to {last}"
    elif last:
        story = f"To max {last}"
    else:
        story = "No restrictions"
    return story


### ----------------------------- Decode barcode data -----------------------------

def jstring_to_bc_dict(jstrings=None):
    """ Load all barcode data structs (from encoded string)
    
    Return dict with [name] = {'data': data, 'dict': dict}
    """
    # If not given string (normal in script), then process global string
    global global_bc_jstrings
    if not jstrings:
        jstrings = global_bc_jstrings
        
    # Split big string into lines to process
    lines = jstrings.split('\n')
    #print(f"Total {len(lines)} lines in string with {len(jstrings)} char")
        
    # Collect data(frames) and dicts for each barcode
    bc_data = {}
    bc_dict = {}
    # Init name, data lines and data type 
    name = dlines = dtype = ''
    # Split string by line to process 
    for line in jstrings.split('\n'):        
        if line.startswith('>bc_d'):
            #print(line)
            # Prior collected data            
            if dlines:
                # String to object (dict)
                obj = json.loads(zlib.decompress(base64.b64decode(dlines)))
                # Seq data saved as dict but should be dataframe
                if dtype == 'data':                
                    obj = pd.DataFrame(obj)
                # Save to dict
                save_dict = bc_data if dtype == 'data' else bc_dict                
                save_dict[name] = obj
                # Next encoded obj
                dlines = ''
            # New name and type; Header like:
            #   >bc_data n192_v4 from bc_data_n192_v4.csv
            dtype = 'dict' if 'bc_dict' in line else 'data'
            name = line.split()[1]
        else:
            dlines += line.strip()
    # Last one
    if dlines:
        # String to object (dict)
        obj = json.loads(zlib.decompress(base64.b64decode(dlines)))
        # Seq data saved as dict but should be dataframe
        if dtype == 'data':                
            obj = pd.DataFrame(obj)
        # Save to dict
        save_dict = bc_data if dtype == 'data' else bc_dict                
        save_dict[name] = obj

    # Combined data and dict per barcode set
    new_dict = {}
    for k in bc_data.keys():
        new_dict[k] = {'data': bc_data[k], 'dict': bc_dict[k]}
    return new_dict


def fastq_bc_seqs_df(fastq, amp_seq, samp_size=BC_SAMP_SIZE, samp_skip=BC_SAMP_SKIP, verb=True):
    """ Get dataframe sample of per-sequence barcodes
        
    Return dataframe with barcode seq and qual
    """
    if verb:
        print(f"# Sampling {samp_size} reads from {fastq}")
    
    min_seq_len = len(amp_seq)
    bc_starts, bc_ends = get_amp_part_bounds(amp_seq)

    seqs = []
    quals = []
    n_rec = 0
    n_read = 0
    with gzip.open(fastq) as f2_file:
        while n_read < samp_size:
            f2_file.readline()
            seq = f2_file.readline().decode()[:-1]
            f2_file.readline()
            qual = f2_file.readline().decode()[:-1]
            
            if not seq:
                break
            n_rec += 1
            
            if n_rec <= samp_skip:
                continue
                
            if len(seq) >= min_seq_len:
                n_read += 1
                seqs.append(seq)
                quals.append(qual)

    if verb:
        print(f"# Collected {n_read} data from {n_rec} fastq records")
    
    seqs = pd.Series(seqs)
    quals = pd.Series(quals)

    bc_df = pd.DataFrame()
    # Extract subseqs
    #bc_df['seq'] = seqs
    bc_df['bc1'] = seqs.str.slice(bc_starts[1], bc_ends[1])
    bc_df['bc2'] = seqs.str.slice(bc_starts[2], bc_ends[2])
    bc_df['bc3'] = seqs.str.slice(bc_starts[3], bc_ends[3])
    
    #bc_df['qual'] = quals
    bc_df['qc1'] = quals.str.slice(bc_starts[1], bc_ends[1])
    bc_df['qc2'] = quals.str.slice(bc_starts[2], bc_ends[2])
    bc_df['qc3'] = quals.str.slice(bc_starts[3], bc_ends[3])
    
    return bc_df


### ----------------------------- Kit guess from data -----------------------------

def guess_kit_from_bc(comargs, all_bc_dict, fq2_df, verb=True):
    """ Guess kit from sampled barcodes and list of barcode sets
    
    Return tuple (kit, score)
    """
    kit_bc_dict = kit_round1_bc_dict()
    if verb:
        print(f"# Scoring {len(fq2_df.index)} barcodes against {len(kit_bc_dict)} kits")
        
    # Get counts of bc1 seqs, log10
    counts = np.log10(fq2_df['bc1'].value_counts())

    # Screen kits and barcode sets
    best_kit = best_score = None
    for kit, bc in kit_bc_dict.items():
        # Set of sequences
        bc_df = all_bc_dict[bc]['data']
        bc_set = set(bc_df['sequence'])
        score = bc_count_kit_score(counts, bc_set)
        if (not best_score) or (score > best_score):
            best_score = score
            best_kit = kit
        if verb:
            print(f"#   {kit} ({bc}) = {round(score,3)}")
            
    if verb:
        print(f"# Best scoring kit = {best_kit}, {round(best_score,3)}")
    return best_kit, best_score


def bc_count_kit_score(counts, bc_set, remain_frac=0.2, verb=False):
    """ Calculate the score of fastq barcode seq counts for given barcode set
    
    Return score
    """
    # Split counts into first and remaining parts
    # First part of counts = top N-bc counts
    f_tot = len(bc_set)
    f_counts = counts.iloc[:f_tot]
    f_num = len(set(f_counts.index) & bc_set)
    f_frac = f_num / f_tot
    f_mean = f_counts.mean()

    # Remaining part of counts via slice and threshold
    r_counts = counts.iloc[f_tot:]
    # Thresh = fraction of values in first part
    r_thresh = f_mean * remain_frac
    r_counts = r_counts[r_counts >= r_thresh]
    r_tot = len(r_counts.index)
    # None case
    if r_tot < 1:
        r_num = 0
        r_mean = r_frac = 0
    else:
        r_num = len(set(r_counts.index) & bc_set)
        r_frac = r_num / r_tot
        r_mean = r_counts.mean()
            
    if verb:
        print(f_tot, f_mean, r_thresh, sep='\t')
        print(f_num, f_frac, f_mean, sep='\t')
        print(r_num, r_frac, r_mean, sep='\t')
    
    score = f_frac - r_frac
    return score


